Требуемый опыт работы: 3–6 лет

Полная занятость, полный день

ООО «СИМАКС»- резидент ГАУ ТО "Западно-Сибирский инновационный центр" (Тюменский технопарк)

Компания занимается разработкой автоматизированного программного комплекса по безопасности труда для проведения обучения, аттестаций, инструктажей руководителей и специалистов, осуществления производственного контроля.

Обязанности:

Разработка и развитие собственных крупных проектов компании.
Требования:
Хорошее знание JavaScript (ES5, ES6);
Опыт работы с современным фреймворком Vue3 более года;
Уверенное знание методов взаимодействия с сервером (REST);
Хорошее знание CSS и HTML, адаптивная верстка;
Опыт работы с CSS препроцессорами (LESS/SASS/...);
Умение пользоваться Git;
Навыки работы в команде.
Условия:
работа в комфортабельном, современном офисе Тюмени;
работу в команде профессионалов высокого уровня, условия для профессионального и личного развития;
стабильная заработная плата;
премирование за успешную реализацию проектов;
возможность посещения конференций и курсов.
